//    1 2 3 4 5
      // x x   x
// f: 1 4 2 5 3
// k: 1
// d: 1 3 5 2 4
// r: 3
class Solution {
 public:
  int kEmptySlots(std::vector<int>& f, int k) {
    int n = f.size();
    std::vector<int> d(n);
    for (int i = 0; i < n; ++i)
      d[f[i]-1] = i+1;

    // traverse
    int left = 0;
    int right = k+1;
    int r = std::numeric_limits<int>::max();
    for (int i = 0; right < n; ++i) {
      if (d[i] < d[left] || d[i] <= d[right]) {
        if (i == right) {
          r = std::min(r, std::max(d[left], d[right]));
        }
        left = i;
        right = k + 1 + i;
        printf("%d %d %d\n", i, left, right);
      }
    }

    return r == std::numeric_limits<int>::max() ? -1: r;
  }
};

